import React from 'react';
import Header from './Header';
import Footer from './Footer';
import List from './List';
import Top from './Top';
import Main from './Main';

const menuMakanan = [
  {
    nama: 'Mie Ayam',
    harga: 10000
  },
  {
      nama: 'Bakso',
      harga: 15000
  },
  {
      nama: 'Mie Ayam Bakso',
      harga: 20000
  },
  {
      nama: 'Soto',
      harga: 10000
  }
]


function App() {
  return (
    <div  >
      <Header/>
      <Top/>
      <Main/>
      <List/>
      <Footer name="Makanan Nusantara"/>
    </div>
  );
}
export default App;
